import java.util.ArrayList;
import java.util.Collections;
import java.util.HashMap;
import java.util.List;

class Solution {
    public List<String> findHighAccessEmployees(List<List<String>> access_times) {
        HashMap<String, List<Integer>> employeeTimes = new HashMap<>();
        for (List<String> access : access_times) {
            String name = access.get(0);
            int time = Integer.parseInt(access.get(1));
            employeeTimes.putIfAbsent(name, new ArrayList<>());
            employeeTimes.get(name).add(time);
        }

        List<String> result = new ArrayList<>();
        for (String employee : employeeTimes.keySet()) {
            List<Integer> times = employeeTimes.get(employee);
            Collections.sort(times);
            for (int i = 0; i < times.size(); i++) {
                int count = 1;
                for (int j = i + 1; j < times.size() && times.get(j) - times.get(i) < 100; j++) {
                    if (times.get(j) / 100 == times.get(i) / 100 || 
                        (times.get(j) / 100 == times.get(i) / 100 + 1 && times.get(j) % 100 < times.get(i) % 100)) {
                        count++;
                    }
                }
                if (count >= 3) {
                    result.add(employee);
                    break;
                }
            }
        }

        return result;
    }
}
